wikitext.*:
本模板用于把0到9999的阿拉伯数字转换成对应的小写中文数字。

==参数==
*位置参数1：数字。

==例子==
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|0}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|0}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|10}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|10}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|20}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|20}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|100}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|100}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|101}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|101}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|110}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|110}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1000}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1000}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1001}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1001}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1010}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1010}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1100}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1100}}
*<code><nowiki>{{User:Hydrofluorina/四位中文数字|1101}}</nowiki></code> → {{User:Hydrofluorina/四位中文数字|1101}}
